    return (
      <>
      <Header />
  
      <section className="section">
            <h2 className="section__title">Article Title</h2>
            <span className="section__subtitle">This is the subtitle of the article.</span>
      </section>
  
      <Footer />
      <ScrollUp />
      </>
    );
  };


export default ConvolutionalNeuralNetworks
